('Умеренный муссонный климат', 'Тип климата по классификации Алисова Б.П., характерный для восточной Азии. Зимой окраина материка оказывается на периферии азиатского антициклона и здесь преобладает перенос холодного воздуха из Восточной Сибири. Поэтому зима здесь малооблачная и сухая со значительными холодами и резким минимумом осадков. Летом же над востоком Азии господствует циклоническая деятельность с достаточно обильными осадками.', 23);


